    }
  }

  -webkit-animation: @animation-name @duration ease;
  animation: @animation-name @duration ease;
}

.fadein(@duration: 0.45s) {
  overflow: hidden;
  .fade(fadein, 0, 1, 0, 2000px, @duration);
}

.fadeout(@duration: 0.45s) {
  overflow: hidden;
  .fade(fadeout, 1, 0, 2000px, 0, @duration);
}

